(34, 'page', 1, NULL, '<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: normal; font-style: normal; font-size: 15px; line-height: 21px; font-family: ''Helvetica Neue'', arial, sans-serif; color: #42474a; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">Yes, they are. Quite a lot of them, in fact. Indeed, the majority.</p>\r\n<p style="box-sizing: border-box; margin: 0px 0px 15px; padding: 0px; border: 0px; font-weight: normal; font-style: normal; font-size: 15px; line-height: 21px; font-family: ''Helvetica Neue'', arial, sans-serif; color: #42474a; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">Anyone else remember when Netscrape cost $120 a copy? I do. And then someone came along and gave us a browser for free, just as the WWW launched, quickly capturing over 90% of the market. And everyone designed for IE and all was right with the world. But the bitch hadn''t died, she bore a bastard son who grew up to lead a small gang of hooligans, cheered on by a simpering mob of web "designers" who decried all things proprietary but today&nbsp;think -o- -moz- and -webkit- are somehow part of a standard. They spend their days creating complex gobs of proprietary-based kiddie code. None of which, by the way, works with older versions of ANY browser, so cool out on the hating (anyone who''s still writing M$ in their copy is a punk hater, pure and simple).</p>\r\n<p style="box-sizing: border-box; margin: 0px; padding: 0px; border: 0px; font-weight: normal; font-style: normal; font-size: 15px; line-height: 21px; font-family: ''Helvetica Neue'', arial, sans-serif; color: #42474a; font-variant: normal; letter-spacing: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">I don''t code for IE5.5 on Mac and neither should you. SImilarly, IE6 and IE7 are dead. XP is almost 15 years old and when it dies IE 8 will die with it. News flash: Win8 is right around the corner and IE10 . . . well . . . you''ll seeeeeeee.</p>', NULL, NULL, NULL, NULL, 'inoerp', '05-08-2013 10:55:09', 'inoerp', '05-08-2013 10:55:09'),
