(82, 'page', 61, NULL, '<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;"><span style="color: #993300;"><strong>LPN Management:</strong></span>Warehouse Management enables operators to track the contents of any container in receiving, WIP, inventory, shipping, and in-transit.</p>\n<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">In Oracle Warehouse Management, a license plate number (LPN) is any object that holds items. Although LPNs are associated with containers, they do not need to represent a physical entity, such as a box. Thus, you can define an LPN as a collection of items. Oracle Warehouse Management enables you to track, transact, and nest LPNs.</p>\n<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;"><span style="color: #993300;"><strong>Advanced Lot and Serial Control:</strong></span><span class="Apple-converted-space">&nbsp;</span>Warehouse Management enables operators to split, merge, and rename lots.</p>', NULL, NULL, NULL, NULL, 'inoerp', '09-08-2013 10:47:48', 'inoerp', '09-08-2013 10:47:48'),
