(162, '<p>All three are language construct (not functions). The functionality & usage of die/exit is same. You use both to completely stop the program from executing further.</p>\r\n<blockquote>\r\n<p><span style="text-decoration: underline;"><strong>Die/Exit</strong></span><br />1. Program stop as soon as the die/exit is reached.<br />2. Program wont read/execute any codes/files included after these statements.<br />3. You can show a message by putting it in parentheses of die/exit.<br />Ex: exit("The status of process further is ($process_further)!");<br /><br /><span style="text-decoration: underline;"><strong>Return</strong></span><br />Return can be used in a function, eval() statement or file.<br />1. In a function, it stops the execution of the functions and returns the Return statement argument as returned value.<br />2. In an included file, it stops the execution of the file where its used and goes back to the original file from where it was included.<br />3. In an eval() stamen, it stop the execution of the statement.</p>\r\n</blockquote>', 'PHP'),
(164, '<p>All three are language construct (not functions). The functionality & usage of die/exit is same. You use both to completely stop the program from executing further.<br /><br />Die/Exit<br />1. Program stop as soon as the die/exit is reached.<br />2. Program wont read/execute any codes/files included after these statements.<br />3. You can show a message by putting it in parentheses of die/exit.<br />Ex: exit("The status of process further is ($process_further)!");<br /><br />Return<br />Return can be used in a function, eval() statement or file.<br />1. In a function, it stops the execution of the functions and returns the Return statement argument as returned value.<br />2. In an included file, it stops the execution of the file where its used and goes back to the original file from where it was included.<br />3. In an eval() stamen, it stop the execution of the statement.<br /><br /></p>', 'PHP'),
(165, '<p>Including files in a referenced file<br />Including a file in php is easy.<br /><br />1. File in same directory<br />Inclue_once file_name.php;<br /><br />2. File in one upper level directory<br />include_once("../file_name.inc")<br /><br />3. File in two upper level directory<br />include_once("../../../file_name.inc")<br /><br />But including a file which is called in from another file is tricky.<br />Ex: filea.php includes a file as<br />include_once("../../../fileb.inc")<br /><br />Now suppose fileb needs to include another file which is in one level up from it then you cant write<br />include_once("../filec.inc").<br /><br />This means you are trying to access the file fileb from one level up from the directory where the original file filea resides<br />You have to use dirname(__FILE__) or __DIR__ to include file c<br />include(dirname(__FILE__).''/../filec.inc'');<br /><br /></p>\r\n<p></p>\r\n<p>SELECT * FROM content</p>', 'PHP'),
(166, '<p>dsdsfds</p>', 'PHP'),
