(106, '[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]CHENNAI:<span class="Apple-converted-space"> [/color]</span><span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15.555556297302246px; background-color: #ffffff; cursor: pointer; color: #0000ff !important; font-family: georgia; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">India''s wait</span>[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]<span class="Apple-converted-space"> [/color]for a successful flight of a GSLV rocket fitted with an<span class="Apple-converted-space"> </span></span>[url=http://timesofindia.indiatimes.com/topic/Indigenous-(musician)]indigenous[/url][color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]cryogenic engine will prolong till mid December.[/color]<span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15.555556297302246px; background-color: #ffffff; cursor: pointer; color: #0000ff !important; font-family: georgia; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">Indian Space Research Organisation</span>[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]<span class="Apple-converted-space"> [/color](Isro)</span><span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15.555556297302246px; background-color: #ffffff; cursor: pointer; color: #0000ff !important; font-family: georgia; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">chairman K Radhakrishnan</span>[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]<span class="Apple-converted-space"> [/color]told TOI on Wednesday that GSLV-D5, whose launch on August 19 as aborted because of a leak in<span class="Apple-converted-space"> </span></span><span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15.555556297302246px; background-color: #ffffff; cursor: pointer; color: #0000ff !important; font-family: georgia; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">the liquid fuel tank</span>[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none], had to be disassembled and studied closely before the next launch which is likely to be more than four months later.[/color]<br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" /><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" />[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]"We had a detailed review on Monday and decided to change the second stage of the rocket which has some damage," Radhakrishnan said. "The four strap-ons, the tank and<span class="Apple-converted-space"> [/color]</span><span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15.555556297302246px; background-color: #ffffff; cursor: pointer; color: #0000ff !important; font-family: georgia; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">the fuel components</span>[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]<span class="Apple-converted-space"> [/color]have to be changed." While the liquid propellant tank will be shifted to the Isro centre in Mahendragiri in<span class="Apple-converted-space"> </span></span>[url=http://timesofindia.indiatimes.com/topic/Tamil-Nadu]Tamil Nadu[/url][color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none], where another second stage of the rocket will be prepared, the indigenous cryogenic engine, the GSAT-14<span class="Apple-converted-space"> [/color]</span>[url=http://timesofindia.indiatimes.com/topic/Satellite]satellite[/url][color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]<span class="Apple-converted-space"> [/color]and the heat shield components will remain at the Sriharikota spaceport.</span><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" /><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" />[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]Isro scientists said they didn''t want to leave anything to chance with the next GSLV launch which is prestigious because its puts to test the indigenous cryogenic engine capabilities. India is left with just one of the seven Russian cryogenic engines it had bought, and needs to develop its own cryogenic engines to propel bigger rockets with up to 5,000 tonnes of payload.[/color]<br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" /><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" />[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]While Isro has perfected its PSLV rockets, which have had a string of 23 successes, the nation''s prestigious missions including the manned space mission rest on GSLVs. Isro''s first attempt with an indigenous cryogenic engine in April 2010 has been a failure. The second one, slated for August 19, 2013, had to be called off a couple of hours before the scheduled lift-off after one of the cameras at the launch pad detected a fuel leak in the second stage of the rocket.[/color]'),
(107, 'Rupee rallies on oil window, jumps to 67.20 per dollar\r\n\r\nEarlier on Wednesday, the currency had collapsed to a lifetime low of 68.85 against the dollar and closed at 68.80, registering its biggest single-day loss of 256 paise, as global oil prices jumped, deepening concerns about the current account deficit and capital outflows.\r\n\r\n\r\nTNN|Aug 29, 2013, 09.29AM IST\r\n\r\nNEW DELHI: Therupeeon Thursday regained the 66 level on RBI''s move to provide dollars to oil companies.\r\n\r\nThe rupee opened 130 paise stronger at 67.20 perdollarand moved higher in early morning trade.\r\n\r\nTheSensexandNiftyalso opened in green in early morning trade on Thursday. The Sensex was trading at 18,152.23, up 156 points at 9.50am.'),
(108, '[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]The partially convertible rupee was trading at 66.90/91 per dollar at 9:10am (0340 GMT), 2.8 per cent stronger than its close of 68.80/81 on Wednesday, when it hit a record low of 68.85.<span class="Apple-converted-space"> [/color]</span><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" /><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" />[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]The benchmark 10-year bond yield also gained tracking the rupee, with the yield falling as much as 21 basis points to 8.75 per cent.<span class="Apple-converted-space"> [/color]</span><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" /><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" />[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]Earlier on Wednesday, the rupee fell by a record 264 paise against the dollar to close at 68.83 on Wednesday as the likelihood of a US-led strike against Syria increased, sending crude prices soaring. The Reserve Bank of India responded to the fall by announcing a move to provide dollars from its reserves to meet import needs of oil companies which account for nearly 40% of demand for dollars in a normal month.<span class="Apple-converted-space"> [/color]</span><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" /><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" />[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]The free-fall of the rupee resulted in a surge in demand for gold, which saw its biggest-ever single day surge of Rs 2,500 to hit Rs 34,500 per 10 gram. The sensex, which at one point was down 533 points, recovered sharply to close 28 points higher at 17,996 after LIC stepped in to buy shares in a big way.<span class="Apple-converted-space"> [/color]</span><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" /><br style="margin: 0px; padding: 0px; color: #3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;" />[color=#3f3f3f; font-family: georgia; font-size: 15.555556297302246px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 20px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff; display: inline !important; float: none]The RBI''s move to sell dollars directly to public sector oil companies &mdash; IndianOil, HPCL and BPCL &mdash; has resulted in the rupee firming up in the offshore forward market. Dealers said that the RBI appears to have waited for the rupee to get into an oversold position before coming out with its measures.<span class="Apple-converted-space"> \r\n[/color]</span>'),
