(115, '<p style="margin: 0.4em 0px 0.5em; line-height: 19.200000762939453px; color: #000000; font-family: sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">In the late 1940s, Toyota started studying<span class="Apple-converted-space"> </span>[url=http://en.wikipedia.org/wiki/Supermarket]supermarkets[/url]<span class="Apple-converted-space"> </span>with the idea of applying store and shelf-stocking techniques to the factory floor. In a supermarket, customers obtain the required quantity at the required time, no more and no less. Furthermore, the supermarket stocks only what it expects to sell within a given time frame, and customers take only what they need, since future supply is assured. This observation led Toyota to view a process as being a customer of one or more preceding processes, and the preceding processes are viewed as a kind of store. The customer "process" goes to the store to obtain required components which in turn causes the store to restock. Originally, as in supermarkets, signboards were used to guide "shopping" processes to specific shopping locations within the store.\r\n\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 19.200000762939453px; color: #000000; font-family: sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">Kanban aligns inventory levels with actual consumption; a signal is sent to produce and deliver a new shipment when material is consumed. These signals are tracked through the replenishment cycle, bringing visibility to both the supplier and the buyer.\r\n\r\n<p style="margin: 0.4em 0px 0.5em; line-height: 19.200000762939453px; color: #000000; font-family: sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">Kanban uses the rate of demand to control the rate of production, passing demand from the end customer up through the chain of customer-store processes. In 1953, Toyota applied this logic in their main plant machine shop.<sup id="cite_ref-6" class="reference" style="line-height: 1em; unicode-bidi: -webkit-isolate; font-weight: normal; font-style: normal;">[url=http://en.wikipedia.org/wiki/Kanban#cite_note-6][6][/url]</sup>'),
