(140, '<p><img src="../../files/0_1391003406_Desert.jpg" alt="" width="600" height="450" />The fact that Australia, England and India haveformed a cabal to choke the game of cricket is not exactly new. Like a bum with a sandwich board, myself and others have been walking the streets of cricket shouting this message for a long time. During the Champions Trophy I wrote that only the top threein cricket matter. Before that I started making a documentary on the death of Test cricket. And during this Boxing Day Test at the MCG, I was chatting toABC Grandstand about it.<br /><br />If you follow cricket politicking at all (and I do, so you don''t have too), you could see this coming. So it was nice that Sharda Ugra showed that it was not just a conspiracy theory by a few nut jobs. That it was a real takeover of cricket by the greedy and wealthy.<br /><br />But what does this leaked draft actually mean, and is the working group''s financial and commercial committee actually run by giant lizards? I tried to answer a few questions that people had.<br /><br />In a word, good or bad for Test cricket?<br />Bad, not just for Tests, but for all international cricket.</p>'),
