(161, '<p>Yes, static functions are bad. If you dont believe it, then Google it and you ll find hundreds of articles which ll convince you that fact. (PHP static method bashers dont read below)</p>\r\n<p><br /><strong>So where to use it?</strong><br />Its good feature and instead of defining 1000s of global functions, its better to put them under the class where they do the real function. After, the availability of STATIC keyword there is hardly any reason why you should not use it.<br /><br />Ex : User entered an chart of account combination. You need to validate it. Use a static function. There is no need to instantiate the whole class and then run that function.<br />Classes are not defined only for methods, they are defined to use object oriented architecture.</p>\r\n<p>It saves time & resource.</p>\r\n<p><strong>Where not to use it?</strong><br />Dont use it for any function that does any data base objectives. All the database functions are available under dbObject class. Use them and it ll prevent you from writing any SQL.</p>\r\n<p>Dont use for _before_show , _after_show, _before_submit, _after_submit, _before_save, _after_save, etc<br />all the functions that start with _ should be avaiable to a specific object (dont use __ as thats reserved by PHP)</p>\r\n<p><br />For all the rest of business logic, you are free to use static function/variables. I have decided to move all the business validate functions to static method.</p>'),
(178, '<p>Including files in a referenced file<br />Including a file in php is easy.<br /><br />1. File in same directory<br />Inclue_once file_name.php;<br /><br />2. File in one upper level directory<br />include_once("../file_name.inc")<br /><br />3. File in two upper level directory<br />include_once("../../../file_name.inc")<br /><br />But including a file which is called in from another file is tricky.<br />Ex: filea.php includes a file as<br />include_once("../../../fileb.inc")<br /><br />Now suppose fileb needs to include another file which is in one level up from it then you cant write<br />include_once("../filec.inc").<br /><br />This means you are trying to access the file fileb from one level up from the directory where the original file filea resides<br />You have to use dirname(__FILE__) or __DIR__ to include file c<br />include(dirname(__FILE__).''/../filec.inc'');<br /><br /></p>'),
(179, '<p>Including files in a referenced file<br />Including a file in php is easy.<br /><br />1. File in same directory<br />Inclue_once file_name.php;<br /><br />2. File in one upper level directory<br />include_once("../file_name.inc")<br /><br />3. File in two upper level directory<br />include_once("../../../file_name.inc")<br /><br />But including a file which is called in from another file is tricky.<br />Ex: filea.php includes a file as<br />include_once("../../../fileb.inc")<br /><br />Now suppose fileb needs to include another file which is in one level up from it then you cant write<br />include_once("../filec.inc").<br /><br />This means you are trying to access the file fileb from one level up from the directory where the original file filea resides<br />You have to use dirname(__FILE__) or __DIR__ to include file c<br />include(dirname(__FILE__).''/../filec.inc'');<br /><br /></p>'),
(185, '<p>DELETE FROM gl_journal_line WHERE xxx IN ( SELECT xxx from (<br />SELECT xxx, COUNT(*) c FROM gl_journal_line GROUP BY xxx HAVING c > 1) as xyz )</p>'),
