INSERT INTO `page` (`page_id`, `parent_id`, `subject`, `content`, `content_php_cb`, `show_in_frontpage_cb`, `terms`, `published_cb`, `weightage`, `rev_enabled_cb`, `rev_number`, `created_by`, `creation_date`, `last_update_by`, `last_update_date`) VALUES
(1, 0, 'test02', '<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">Companies sell their products either for cash (immediate payment in the form of a check, credit card, or notes and coins) or as invoiced sales on credit with specific payment terms. Invoiced sales create a receivable in the balance sheet (General Ledger), which represents the money due to the company. The financial health of a company depends on keeping track of its customers and ensuring prompt collection of the money owed.\r\n\r\n<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">1. Receivables produces three legal documents to notify customers of their obligations:\r\n\r\n<ul style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">\r\n<li>      An invoice is usually sent shortly after a sale has been made. It states the obligation and provides details.</li>\r\n<li>      A statement is a summary of the transactions over a period of time. It shows all open transactions. It may also show payments made within the period.</li>\r\n<li>      A dunning notice informs the customer of past-due obligations.</li>\r\n</ul>\r\n<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">Companies can choose not to use both statements and dunning notices. However, because they are legal documents, most companies retain the ability to produce all three document types in a paper format. In the interests of efficiency, however, many now send invoices by EDI, fax, or e-mail, and they may agree with established customers to rely exclusively on electronic documents.\r\n\r\n<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">2. The customer can choose to pay the invoice in a variety of ways: by<span class="Apple-converted-space"> </span>[color=#3366ff]check<span class="Apple-converted-space"> [/color][color=#000000]or<span class="Apple-converted-space"> [/color]</span>bank transfer, direct debit,<span class="Apple-converted-space"> </span>[color=#000000]or<span class="Apple-converted-space"> [/color]</span>bill of exchange</span>. When payment is received from the customer, you apply the cash to the customer account, reducing the amount owed and generating journals in GL. A partial payment will reduce the amount owed, but not to zero. The amount owed by each customer can be seen on the Aging Report and Account Detail screen.', NULL, NULL, '', 0, 1, 0, '1', 'inoerp', '2013-08-23 08:16:42', 'inoerp', '2013-08-23 08:16:42'),
(64, NULL, 'The CSS Details', 'The .css() method is a convenient way to get a style property from the first matched element, especially in light of the different ways browsers access most of those properties (the getComputedStyle() method in standards-based browsers versus the currentStyle and runtimeStyle properties in Internet Explorer) and the different terms browsers use for certain properties. For example, Internet Explorer''s DOM implementation refers to the float property as styleFloat, while W3C standards-compliant browsers refer to it as cssFloat. For consistency, you can simply use "float", and jQuery will translate it to the correct value for each browser.\r\n\r\nAlso, jQuery can equally interpret the CSS and DOM formatting of multiple-word properties. For example, jQuery understands and returns the correct value for both .css( "background-color" ) and .css( "backgroundColor" ). Different browsers may return CSS color values that are logically but not textually equal, e.g., #FFF, #ffffff, and rgb(255,255,255).\r\n\r\nShorthand CSS properties (e.g. margin, background, border) are not supported. For example, if you want to retrieve the rendered margin, use: $( elem ).css( "marginTop" ) and $( elem ).css( "marginRight" ), and so on.\r\n\r\nAs of jQuery 1.9, passing an array of style properties to .css() will resu', NULL, 1, NULL, 1, NULL, NULL, NULL, 'inoerp', '2013-08-23 11:58:41', 'inoerp', '2013-08-23 11:58:41'),
(55, 0, 'asdas', 'global $db;\r\n$sql="SELECT * from page order by creation_date desc LIMIT 0, 20";\r\n$result = $db->find_by_sql($sql);\r\n\r\necho ''<ul class="page_list">'';\r\nforeach($result as $records){\r\n$data = ''<li>'';\r\n$data .= ''<a href="'';\r\n$data .= HOME_URL;\r\n$data .= ''extensions/page/pages.php?page_id='';\r\n$data .= $records->page_id;\r\n$data .= ''">'';\r\n$data .= $records->subject.''-''.$records->last_update_date;\r\n$data .= ''</a></li>'';\r\necho $data ;\r\n}\r\necho ''</ul>'';', 1, NULL, '', NULL, 0, 0, '', 'inoerp', '2013-08-23 07:48:28', 'inoerp', '2013-08-23 07:48:28'),
(56, 0, 'Kanban Cards', 'Kanban cards are a key component of kanban and signal the need to move materials within a manufacturing or production facility or move materials from an outside supplier in to the production facility. The kanban card is, in effect, a message that signals that there is a depletion of product, parts, or inventory that, when received, the kanban will trigger the replenishment of that product, part, or inventory. Consumption therefore drives demand for more production, and demand for more product is signaled by the kanban card. Kanban cards therefore help create a demand-driven system.\r\n\r\nIt is widely held[citation needed] by proponents of lean production and manufacturing that demand-driven systems lead to faster turnarounds in production and lower inventory levels, thereby helping companies implementing such systems to be more competitive.', NULL, 1, '', 1, 0, 0, '', 'inoerp', '2014-01-23 12:47:08', 'inoerp', '2014-01-23 12:47:08'),
