(60, NULL, 'tell what is being asked here.', '<p><span style="color: #000000; font-family: Arial, ''Liberation Sans'', ''DejaVu Sans'', sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #eeeeee; display: inline !important; float: none;">It''s difficult to tell what is being asked here. This question is ambiguous, vague, incomplete, overly broad, or rhetorical and cannot be reasonably answered in its current form. For help clarifying this question so that it can be reopened,<span class="Apple-converted-space">&nbsp;</span></span><a style="margin: 0px; padding: 0px; border: 0px; font-size: 13px; vertical-align: baseline; background-color: #eeeeee; color: #4a6b82; text-decoration: none; cursor: pointer; font-family: Arial, ''Liberation Sans'', ''DejaVu Sans'', sans-serif; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-position: initial initial; background-repeat: initial initial;" href="http://stackoverflow.com/help/reopen-questions">visit the help center</a><span style="color: #000000; font-family: Arial, ''Liberation Sans'', ''DejaVu Sans'', sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 19px; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #eeeeee; display: inline !important; float: none;">.</span></p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
(2, 0, 'test02', '<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">Throughout the purchasing process you are able to:<br />&bull;<span class="Apple-converted-space">&nbsp;</span><strong>Route transactions according to your approval structure</strong>. Approval authorization limits are defined by amount, charge account, item category, and location. For documents that require your approval, you can review and approve transactions on-line. Also, you can see the full transaction detail and review the action history before you approve a transaction.</p>\r\n<div style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">&bull;<strong><span class="Apple-converted-space">&nbsp;</span>View Approval Status</strong>. Purchasing automatically displays the approval status of your transaction and informs you whether it is Approved, Cancelled, In Process, Incomplete,Pre-Approved, Rejected, or Returned. You know where your transaction is within this flow at all times.</div>\r\n<p style="color: #000000; font-family: Arial, Helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 18px; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; background-color: #ffffff;">&bull; Automatically<span class="Apple-converted-space">&nbsp;</span><strong>generate distribution accounts</strong>. Purchasing uses Account Generator to enter the distribution automatically whenever possible.<br />&bull; Provide<strong><span class="Apple-converted-space">&nbsp;</span>attachments as notes</strong><span class="Apple-converted-space">&nbsp;</span>on transaction headers and lines.</p>', NULL, NULL, '', 0, 0, 0, '', 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
(3, 0, 'test02', '<p>Throughout the purchasing process you are able to:<br />&bull;<span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span><strong>Route transactions according to your approval structure</strong>. Approval authorization limits are defined by amount, charge account, item category, and location. For documents that require your approval, you can review and approve transactions on-line. Also, you can see the full transaction detail and review the action history before you approve a transaction.</p>\r\n<p>&nbsp;</p>\r\n<div>&bull;<strong><span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span>View Approval Status</strong>. Purchasing automatically displays the approval status of your transaction and informs you whether it is Approved, Cancelled, In Process, Incomplete,Pre-Approved, Rejected, or Returned. You know where your transaction is within this flow at all times.</div>\r\n<p>&bull; Automatically<span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span><strong>generate distribution accounts</strong>. Purchasing uses Account Generator to enter the distribution automatically whenever possible.<br />&bull; Provide<strong><span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span>attachments as notes</strong><span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span>on transaction headers and lines.</p>', NULL, NULL, '', 0, 0, 0, '', 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
(4, 1, 'test02', '<p>Throughout the purchasing process you are able to:<br />&bull;<span class="\\&quot;\\\\&quot;Apple-converted-space\\\\&quot;\\&quot;">&nbsp;</span><strong>Route transactions according to your approval structure</strong>. Approval authorization limits are defined by amount, charge account, item category, and location. For documents that require your approval, you can review and approve transactions on-line. Also, you can see the full transaction detail and review the action history before you approve a transaction.</p>\r\n<p>&bull;<strong><span class="\\&quot;\\\\&quot;Apple-converted-space\\\\&quot;\\&quot;">&nbsp;</span>View Approval Status</strong>. Purchasing automatically displays the approval status of your transaction and informs you whether it is Approved, Cancelled, In Process, Incomplete,Pre-Approved, Rejected, or Returned. You know where your transaction is within this flow at all times.</p>\r\n<p>&bull; Automatically<span class="\\&quot;\\\\&quot;Apple-converted-space\\\\&quot;\\&quot;">&nbsp;</span><strong>generate distribution accounts</strong>. Purchasing uses Account Generator to enter the distribution automatically whenever possible.<br />&bull; Provide<strong><span class="\\&quot;\\\\&quot;Apple-converted-space\\\\&quot;\\&quot;">&nbsp;</span>attachments as notes</strong><span class="\\&quot;\\\\&quot;Apple-converted-space\\\\&quot;\\&quot;">&nbsp;</span>on transaction headers and lines.</p>', NULL, NULL, '', 0, 0, 0, '', 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
