(14, NULL, 'test01', '<p>NEW DELHI:<span class="Apple-converted-space">&nbsp;</span><span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15px; cursor: pointer; color: #0000ff !important; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">The Congress leadership</span><span class="Apple-converted-space">&nbsp;</span>bit the Telangana bullet on Tuesday. It decided to bifurcate Andhra Pradesh to create<span class="Apple-converted-space">&nbsp;</span><span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15px; cursor: pointer; color: #0000ff !important; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">a separate state of Telangana</span><span class="Apple-converted-space">&nbsp;</span>&mdash; a move that will be a loss to the politically muscular state but will be a gain for the Congress as it''s expected to revive the party''s fortunes in the state ahead of the 2014<span class="cm_word" style="margin: 0px; padding: 0px 3px 0px 0px; border-top-width: 0px; border-right-width: 0px; border-bottom-width: 1px !important; border-left-width: 0px; border-bottom-style: solid !important; border-bottom-color: #0000ff !important; outline: 0px; font-size: 15px; cursor: pointer; color: #0000ff !important; text-decoration: underline !important; background-position: 0px 50%; background-repeat: initial initial;">Lok Sabha election</span>.<br style="margin: 0px; padding: 0px;" /><br style="margin: 0px; padding: 0px;" />As reported by TOI on July 29, Hyderabad will remain the common capital of the splintered states for 10 years &mdash; a balancing act that recognizes Telangana''s claim on the city but seeks to soften the blow to the opponents who were also concerned about the investments of coastal Andhra businesses in the capital. The Centre will help AP build a new capi</p>', NULL, NULL, NULL, NULL, 1, NULL, '1', 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
