(16, NULL, 'page14', '<p>NEW DELHI:<span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span><span class="\\&quot;cm_word\\&quot;">The Congress leadership</span><span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span>bit the Telangana bullet on Tuesday. It decided to bifurcate Andhra Pradesh to create<span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span><span class="\\&quot;cm_word\\&quot;">a separate state of Telangana</span><span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span>&mdash; a move that will be a loss to the politically muscular state but will be a gain for the Congress as it\\''s expected to revive the party\\''s fortunes in the state ahead of the 2014<span class="\\&quot;cm_word\\&quot;">Lok Sabha election</span>.<br /><br />As reported by TOI on July 29, Hyderabad will remain the common capital of the splintered states for 10 years &mdash; a balancing act that recognizes Telangana\\''s claim on the city but seeks to soften the blow to the opponents who were also concerned about the investments of coastal Andhra businesses in the capital. The Centre will help AP build a new capi</p>', NULL, NULL, NULL, NULL, 1, NULL, '1', 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
(17, NULL, 'page16', '<p>NEW DELHI:<span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span><span class="\\&quot;cm_word\\&quot;">The Congress leadership</span><span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span>bit the Telangana bullet on Tuesday. It decided to bifurcate Andhra Pradesh to create<span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span><span class="\\&quot;cm_word\\&quot;">a separate state of Telangana</span><span class="\\&quot;Apple-converted-space\\&quot;">&nbsp;</span>&mdash; a move that will be a loss to the politically muscular state but will be a gain for the Congress as it\\''s expected to revive the party\\''s fortunes in the state ahead of the 2014<span class="\\&quot;cm_word\\&quot;">Lok Sabha election</span>.<br /><br />As reported by TOI on July 29, Hyderabad will remain the common capital of the splintered states for 10 years &mdash; a balancing act that recognizes Telangana\\''s claim on the city but seeks to soften the blow to the opponents who were also concerned about the investments of coastal Andhra businesses in the capital. The Centre will help AP build a new capi</p>', NULL, NULL, NULL, NULL, 1, NULL, '1', 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
