(44, NULL, 'ewrewrw', '<table class="commsTable" style="width: 630px; padding: 0px; margin: 10px 0px; border: 1px solid #6699cc; border-collapse: collapse; color: #000000; font-family: tahoma, geneva, arial, verdana, helvetica, sans-serif; font-size: 12px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: start; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">\r\n<tbody>\r\n<tr style="text-align: left; vertical-align: top;">\r\n<td style="padding: 1px 5px; font-family: arial, verdana, helvetica, sans-serif; font-size: 13px; font-weight: normal; text-decoration: none;" colspan="2">\r\n<p class="commsText" style="color: #000000; font-family: arial, verdana, helvetica, sans-serif; font-size: 13px; font-weight: normal; text-decoration: none; margin: 0px; padding: 2px 0px;">House_of_stone: "Both these two have an opportunity to get big scores now with 25 overs to go, Chigumbura is in good form while Williams if he doesn''t go cheaply can get some good runs, we need to show some back bone."</p>\r\n</td>\r\n</tr>\r\n<tr style="text-align: left; vertical-align: top;">\r\n<td style="padding: 1px 5px; font-family: arial, verdana, helvetica, sans-serif; font-size: 13px; font-weight: normal; text-decoration: none;" align="right" width="30">&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
(45, 0, 'TEST01', '<p><strong style="color: #000000; font-family: arial, verdana, helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;">11.55 am</strong><span style="color: #000000; font-family: arial, verdana, helvetica, sans-serif; font-size: 13px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px; display: inline !important; float: none;"><span class="Apple-converted-space">&nbsp;</span>Zimbabwe have been shot out in 39.5 overs, another woeful batting performance and another total that is unlikely to stretch this Indian batting line-up.</span></p>', NULL, NULL, '', 0, 0, 0, '', 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
