(51, NULL, 'asdas', '<p class="commsText" style="color: #000000; font-family: arial, verdana, helvetica, sans-serif; font-size: 13px; font-weight: normal; text-decoration: none; margin: 0px; padding: 2px 0px; font-style: normal; font-variant: normal; letter-spacing: normal; line-height: normal; orphans: auto; text-align: left; text-indent: 0px; text-transform: none; white-space: normal; widows: auto; word-spacing: 0px; -webkit-text-stroke-width: 0px;"><strong>12.35 pm</strong><span class="Apple-converted-space">&nbsp;</span>The players have gone off the field for lunch with India in a strong position to chase down Zimbabwe''s 163 in quick time. They have sped to 43 in six overs but are lucky to still have Dhawan batting. He was dropped in the final over before the break.</p>\r\n<p>&nbsp;</p>', NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'inoerp', '0000-00-00 00:00:00', 'inoerp', '0000-00-00 00:00:00'),
