(65, 0, '', '<?php \r\nglobal $db;\r\n$sql="SELECT content.content_id as content_id, content.subject as subject from content, c_forum  where c_forum.content_id=content.content_id order by content.creation_date desc LIMIT 0, 20";\r\n$result = $db->result_array($sql);\r\n\r\necho ''<ul class="forum_list">'';\r\nforeach($result as $records){\r\n$data = ''<li>'';\r\n$data .= ''<a href="'';\r\n$data .= HOME_URL;\r\n$data .= ''extensions/content/contents.php?content_id='';\r\n$data .= $records[''content_id''];\r\n$data .= ''&content_type=c_forum'';\r\n$data .= ''">'';\r\n$data .= $records[''subject''];\r\n$data .= ''</a></li>'';\r\necho $data ;\r\n}\r\necho ''</ul>'';', NULL, NULL, '', 0, 0, 0, '', 'inoerp', '2013-08-29 07:37:25', 'inoerp', '2013-08-29 07:37:25'),
(66, 0, 'Operations', 'One important determinant of the success of production scheduling based on demand "pushing" is the ability of the demand-forecast to receive such a "push". Kanban, by contrast, is part of an approach where the "pull" comes from the demand. The supply or production is determined according to the actual demand of the customers. In contexts where supply time is lengthy and demand is difficult to forecast, often, the best one can do is to respond quickly to observed demand. \r\n\r\nThis situation is exactly what a kanban system accomplishes, in that it is used as a demand signal that immediately travels through the supply chain. This ensures that intermediate stocks held in the supply chain are better managed, and are usually smaller. Where the supply response is not quick enough to meet actual demand fluctuations, thereby causing significant lost sales, stock building may be deemed more appropriate, and is achieved by placing more kanban in the system.\r\n\r\n\r\nTaiichi Ohno stated that to be effective, kanban must follow strict rules of use.[7] Toyota, for example, has six simple rules, and close monitoring of these rules is a never-ending task, thereby ensuring that the kanban does what is required.', NULL, NULL, '', 0, 0, 0, '', 'inoerp', '2014-01-23 12:45:53', 'inoerp', '2014-01-23 12:45:53'),
(67, 0, 'Abouout Kanban', 'In the late 1940s, Toyota started studying supermarkets with the idea of applying store and shelf-stocking techniques to the factory floor. In a supermarket, customers obtain the required quantity at the required time, no more and no less. Furthermore, the supermarket stocks only what it expects to sell within a given time frame, and customers take only what they need, since future supply is assured. This observation led Toyota to view a process as being a customer of one or more preceding processes, and the preceding processes are viewed as a kind of store. The customer "process" goes to the store to obtain required components which in turn causes the store to restock. Originally, as in supermarkets, signboards were used to guide "shopping" processes to specific shopping locations within the store.\r\n\r\n\r\nKanban aligns inventory levels with actual consumption; a signal is sent to produce and deliver a new shipment when material is consumed. These signals are tracked through the replenishment cycle, bringing visibility to both the supplier and the buyer.\r\n\r\n\r\nKanban uses the rate of demand to control the rate of production, passing demand from the end customer up through the chain of customer-store processes. In 1953, Toyota applied this logic in their main plant machine shop.[6]', NULL, NULL, '', 1, 0, 0, '', 'inoerp', '2014-01-23 12:42:19', 'inoerp', '2014-01-23 12:42:19'),
(68, 0, 'Late static bindings', 'Late static bindings tries to solve that limitation by introducing a keyword that references the class that was initially called at runtime. Basically, a keyword that would allow you to reference B from test() in the previous example. It was decided not to introduce a new keyword but rather use static that was already reserved.\r\n\r\n', NULL, NULL, '', 1, 0, 0, '', 'inoerp', '2014-01-31 15:21:40', 'inoerp', '2014-01-31 15:21:40'),
(69, 0, 'Forms', '1. Single form only with header - Path\r\n    Single form with header and many tabs - Item\r\n\r\n2. Form with a header and one line - Supplier /Supplier Sites\r\n\r\n3. Form with a header and two different tables in line - Payment Term/Dicsount/Scheudle\r\n\r\n4. Form with a header and multiple lines - Inv Transaction\r\n\r\n5. Form with a header, multiple lines and detailed lines - Option, PO', NULL, NULL, '', 1, 0, 0, '', 'inoerp', '2014-01-23 12:45:02', 'inoerp', '2014-01-23 12:45:02'),
